        return(
            <>
            <Carousel className="zone">
                <div className='a'>
                    <div className="contentStyle pic1">1</div>
                    <ul className="pic10">
                        <li className="compliment">孔武有力</li>
                        <li className="time">202100505</li>
                    </ul>
                </div>
                <div className='b'>
                    <div className="contentStyle pic2">2</div>
                </div>
                <div>
                    <div className="contentStyle pic3">3</div>
                </div>
                <div>
                    <div className="contentStyle pic4">4</div>
                </div>
            </Carousel>
            </>
        );
    }
}

export default Header;
